import React from 'react';
import data from './data.json';

export const Header = () => {
    return (
       <div>

         {data.pages.map(block => block.title)}


         {data.pages.map((data, key) => {
          return (
            <div key={key}>
              {data.company +
                " , " +
                data.ticker +
                " ," +
                data.stockPrice +
                ", " +
                data.timeElapsed}
            </div>
          );
        })}



       </div>
    )
}
export default Header;
